%[text] # example for calculating solar radiation pressure (SRP)  on a flat facet
clc
clear
close all
%[text] ## parameters
const = orbitConst; % constant parameters for orbit
%%
%[text] ## set object parameters
sat.vertices = [0.5 0.5 0
    -0.5 0.5 0
    -0.5 -0.5 0
    0.5 -0.5 0];
sat.faces = [1 2 3
    3 4 1];
[sat.area, sat.pos] = calcAreaObj(sat);
sat.normal = calcNormalObj(sat);
nFacet = size(sat.normal,1); % the number of facet

sat.Cd = [0.5; 0.5];
sat.Cs = [0.5; 0.5];
sat.Ca = 1 - sat.Cd - sat.Cs;
sat.kappa = [0; 0];
sat.F0 = 0.5 .* ones(nFacet, 1);
sat.rho = 0.5;

% check satellite shape
showSC(sat) %[output:5d295c22]
%[text] ## set illumination condition
dAU = 1; % AU
d = au2km(dAU, const) * 10^3; % m
S0 = const.S0; % Solar constant, W/m^2
c = const.c; % light speed, m/s
coeff = -S0 / c / dAU^2;

% sunlight vector from facet to sun
phiI = deg2rad(60);
thetaI = deg2rad(50);
sunB = [sin(thetaI)*cos(phiI), sin(thetaI)*sin(phiI), cos(thetaI)];
sunB = sunB ./ norm(sunB);

NS = sat.normal * sunB';

% perfect speular direction
pSpec = 2 * (sat.normal(1,:) * sunB') * sat.normal(1,:) - sunB;
%%
%[text] ## Lambertian and Perfect Specular Reflection
[sat, cdP, csP] = srpSimple(sat, sunB, d, const);

% sat.force; % srp at each facet, N, nx3 matrix
% sat.torque; % srp torques at each facet, Nm, nx3 matrix

srpF = sum(sat.force, 1) % 1x3 %[output:3f58e064]
srpFcd = sum(cdP, 1) %[output:5e5476de]
srpFcs = sum(csP, 1) %[output:03897479]
srpDir = sum(coeff .* sat.area .* NS .* sunB, 1);

fNorm = norm(srpF);
srpF = srpF ./ fNorm; % for visualization

figure %[output:7fdd8d63]
quiver3(0,0,0, sunB(1),sunB(2), sunB(3),'r') %[output:7fdd8d63]
hold on %[output:7fdd8d63]
quiver3(0,0,0, pSpec(1), pSpec(2), pSpec(3), 'g') %[output:7fdd8d63]
quiver3(0,0,0, srpF(1), srpF(2), srpF(3),'b') %[output:7fdd8d63]
quiver3(0,0,0, srpFcd(1)/fNorm, srpFcd(2)/fNorm, srpFcd(3)/fNorm,'k') %[output:7fdd8d63]
quiver3(0,0,0, srpFcs(1)/fNorm, srpFcs(2)/fNorm, srpFcs(3)/fNorm,'c') %[output:7fdd8d63]
quiver3(0,0,0, srpDir(1)/fNorm, srpDir(2)/fNorm, srpDir(3)/fNorm,'m') %[output:7fdd8d63]
view([90, 0]) %[output:7fdd8d63]
axis equal %[output:7fdd8d63]
xlim([-1 1]), ylim([-1 1]), zlim([-1 1]) %[output:7fdd8d63]
legend('sun', 'perfect specular','total SRP', 'diffuse','specular','direct') %[output:7fdd8d63]
title('Lambertian and perfect specular') %[output:7fdd8d63]

%%
%[text] ## Cook–Torrance model
sat.mCT = 0.12; % roughness %[control:slider:8e78]{"position":[11,15]}
[sat, cdCT, csCT] = srpCT(sat, sunB, d, const); %[output:482b819a]

% sat.force; % srp at each facet, N, nx3 matrix
% sat.torque; % srp torques at each facet, Nm, nx3 matrix

srpF = sum(sat.force, 1) % 1x3
srpFcd = cdCT
srpFcs = csCT
srpDir = sum(coeff .* sat.area .* NS .* sunB, 1);

fNorm = norm(srpF);
srpF = srpF ./ norm(srpF); % for visualization

figure
quiver3(0,0,0, sunB(1),sunB(2), sunB(3),'r')
hold on
quiver3(0,0,0, pSpec(1), pSpec(2), pSpec(3), 'g')
quiver3(0,0,0, srpF(1), srpF(2), srpF(3),'b')
quiver3(0,0,0, srpFcd(1)/fNorm, srpFcd(2)/fNorm, srpFcd(3)/fNorm,'k')
quiver3(0,0,0, srpFcs(1)/fNorm, srpFcs(2)/fNorm, srpFcs(3)/fNorm,'c')
quiver3(0,0,0, srpDir(1)/fNorm, srpDir(2)/fNorm, srpDir(3)/fNorm,'m')
title('Cook--Torrance')
legend('sun', 'perfect specular','total SRP', 'diffuse','specular','direct')
axis equal
xlim([-1 1]), ylim([-1 1]), zlim([-1 1])
view([90, 0])
%[text] ## Ashikhmin–Shirley model
% anisotropy
sat.nu = 100 .* ones(nFacet, 1);
sat.nv = 50 .* ones(nFacet, 1);

[sat, cdAS, csAS] = srpAS(sat, sunB, d, const, 10^5);
srpF = sum(sat.force, 1); % 1x3

srpFcd = sum(cdAS, 1);
srpFcs = sum(csAS, 1);
srpDir = sum(coeff .* sat.area .* NS .* sunB, 1);

% % srpCd + srpCs + srpDir
% % srpF

fNorm = norm(srpF);
srpF = srpF ./ norm(srpF); % for visualization

figure
quiver3(0,0,0, sunB(1),sunB(2), sunB(3),'r')
hold on
quiver3(0,0,0, pSpec(1), pSpec(2), pSpec(3), 'g')
quiver3(0,0,0, srpF(1), srpF(2), srpF(3),'b')
quiver3(0,0,0, srpFcd(1)/fNorm, srpFcd(2)/fNorm, srpFcd(3)/fNorm,'k')
quiver3(0,0,0, srpFcs(1)/fNorm, srpFcs(2)/fNorm, srpFcs(3)/fNorm,'c')
quiver3(0,0,0, srpDir(1)/fNorm, srpDir(2)/fNorm, srpDir(3)/fNorm,'m')
title('Ashikhmin--Shirley')
legend('sun', 'perfect specular','total SRP', 'diffuse','specular','direct')
axis equal
xlim([-1 1]), ylim([-1 1]), zlim([-1 1])


